import React from "react";
//Cart to be rendered

const Cart = ({ product }) => {
  return (
    <section className="flex flex-auto gap-x-80 text-2xl  text-blue-900 text-center">
      <h2>Name: {product.name}</h2>
      <h2> Items: {product.item}</h2>
      <h2> Price: {product.price}</h2>
    </section>
  );
};

export default Cart;
